class="primary-navigation-container container"> <nav id="main-navigation" class="primary-navigation navigation clearfix" role="navigation"><ul id="menu-main-navigation" class="main-navigation-menu menu"></ul> </nav><!-- #main-navigation --></div></div> </header><!-- #masthead --><div id="content" class="site-content container"><div id="primary" class="content-area"> <main id="main" class="site-main"> <article id="post-66" class="post-66 post type-post status-publish format-standard hentry category-mysql"><div class="post-image"></div><div class="post-content"><header class="entry-header"><h1 class="entry-title">Mengenal MySQL untuk Pemula part 1</h1><div class="entry-meta post-details"><span class="posted-on meta-date">Posted on <a href="https://blog.ammarfaizi.net/mysql/mengenal-mysql-untuk-pemula-part-1/" rel="bookmark"><time class="entry-date published updated" datetime="2018-07-14T16:24:52+00:00">2018-07-14</time></a></span><span class="posted-by meta-author"> by <span class="author vcard"><a class="url fn n" href="https://blog.ammarfaizi.net/author/ammarfaizi2/" title="View all posts by Ammar Faizi" rel="author">Ammar Faizi</a></span></span></div> </header><!-- .entry-header --><div class="entry-content clearfix"><p>Sebagai seorang developer kita harus mengetahui secara up to date tentang bahasa pemrograman yang populer saat ini. Meskipun kita tidak bisa menguasai semua bahasa dengan maksimal paling tidak kita bisa mengenalnya. Untuk menguasai banyak bahasa pemrograman tentunya bukanlah hal yang mudah. Namun setidaknya kita memiliki spesialisasi pada salah satu dari mereka. Hal yang penting salah satunya adalah skill SQL.</p><p>Pemahaman yang baik tentang structured query language (SQL) menjadi hal yang sangat penting karena SQL adalah bahasa yang kita gunakan untuk berkomunikasi dengan database.</p><p>Sayangnya kenyataan berkata lain, peningkatan skill SQL menjadi prioritas paling akhir karena kebanyakan programmer terlalu fokus pada hal lain yang lebih menarik seperti:<br /> &#8211; Meningkatkan skill bahasa pemrograman tertentu.<br /> &#8211; Membuat user interface yang atraktif dan user-friendly.<br /> &#8211; Membuat aplikasi yang bisa berjalan di database apapun.<br /> &#8211; dan sebagainya&#8230;</p><p>Hal tersebut mengakibatkan beberapa masalah berikut&#8230;</p><blockquote><p> Pertama, kebanyakan programmer menjadi kurang piawai meracik SQL. Pengetahuan tentang SQL statement hanya sebatas perintah SELECT, INSERT, UPDATE, dan DELETE sederhana saja tanpa memanfaatkan JOIN ataupun clause-clause yang kompleks lainnya. Sehingga SQL statement yang dibuat terkesan asal jadi tanpa memperhatikan performa dan keteraturan data.<br /> Kedua, kebanyakan programmer tidak memanfaatkan kemampuan canggih yang dimiliki database engine yang digunakan. Sebagai contoh adalah hanya memanfaatkan database sebagai data store saja dan proses pengolahan data seluruhnya dilakukan di level aplikasi. Padahal seharusnya pemrosesan data bisa diserahkan ke database dengan memanfaatkan aggregate functions, analytical/windowing functions, dan stored procedures.<br /> Ketiga, membawa gaya pemrograman prosedural saat memproses data. Sebagai contoh untuk insert data massal masih menggunakan query looping (perulangan) di level aplikasi, akibatnya kinerja aplikasi semakin menurun seiring dengan bertambah banyaknya data. Padahal seharusnya saat kita memproses data di database harus menggunakan paradigma berpikir set (himpunan) dan bulk processing, bukan cara prosedural yang asal jadi.</p></blockquote><p>Untuk mengatasi semua masalah di atas, kita sebagai developer harus paham perintah SQL secara luar maupun dalam. Maka dari itu kita perlu membedah isi perintah SQL untuk memahami anatomi-nya.</p><p>Ok mulai dari perintah-perintah dasar.<br /> Perintah SQL memiliki struktur dasar yang harus kita pahami agar kita bisa membuat sebuat perintah SQL yang baik dan benar.</p><p>Perintah SQL terdiri dari beberapa bagian. Terminologi berikut ini tidak perlu dihafalkan tapi harus diketahui dan dipahami, yaitu<br /> &#8211; Statement/Query<br /> &#8211; Clause<br /> &#8211; Predicate<br /> &#8211; Expression</p><blockquote><p> Statement atau biasa disebut sebagai query, adalah keseluruhan perintah itu sendiri.<br /> Clause adalah potongan perintah yang diawali kata kunci SQL tertentu, seperti<br /> &#8211; SELECT cluase.<br /> &#8211; SET clause.<br /> &#8211; FROM clause.<br /> &#8211; UPDATE clause.<br /> &#8211; WHERE clause.<br /> &#8211; JOIN clause.<br /> &#8211; dan sebagainya.<br /> Predicate adalah sebuah kalimat matematika berupa perbandingan antara sebuah field dengan field lain, atau perbandingan antara sebuah field dengan nilai tertentu.<br /> Expression adalah sebuah kalimat matematika yang menghasilkan sebuah nilai tertentu, atau sebuah konstanta nilai tertentu, misalkan string &#8216;OK&#8217;, atau NOW()+10.</p></blockquote><p>Ok, kita mulai membedah query yang simple.</p><p><code>SELECT code, name FROM employees WHERE salary &gt;= 3000000</code></p><p>Ini adalah SELECT clause<br /> <code>SELECT code, name</code></p><p>Ini adalah FROM clause<br /> <code>FROM employees</code></p><p>Ini adalah WHERE clause<br /> <code>WHERE salary &gt;= 3000000</code></p><p>Ini adalah predicate<br /> <code>salary &gt;= 3000000</code></p><p>Dan ini adalah expression<br /> <code>3000000</code></p><p>Masih gampang kan?<br /> Mudahan bisa dipahami.</p><p>&nbsp;</p><div class="sharedaddy sd-sharing-enabled"><div class="robots-nocontent sd-block sd-social sd-social-icon sd-sharing"><h3 class="sd-title">Share this:</h3><div class="sd-content"><ul><li class="share-twitter"><a rel="nofollow" data-shared="sharing-twitter-66" class="share-twitter sd-button share-icon no-text" href="https://blog.ammarfaizi.net/mysql/mengenal-mysql-untuk-pemula-part-1/?share=twitter" target="_blank" title="Click to share on Twitter"><span></span><span class="sharing-screen-reader-text">Click to share on Twitter (Opens in new window)</span></a></li><li class